INSERT INTO `faq` (`id`, `question`, `answer`, `faq_status`, `status`, `created_at`, `modified_at`) VALUES
(1, 'Is this is Official Ngo site ?', 'Yes', 1, 1, '2021-05-05 14:19:26', '2021-05-24 07:28:27'),
(2, 'Is this site controlled by Officials or Professionals of the NGO?', 'Yes', 1, 1, '2021-06-29 13:05:10', '2021-06-29 13:05:10'),
(3, 'What is Crowdfunding?', 'In its simplest form, Crowdfunding is a practice of giving monetary funds to overcome specific social, cultural, or economic hurdles individuals face in their daily lives.', 1, 1, '2021-09-08 09:54:31', '2021-09-08 09:54:31'),
(4, 'How do I raise funds?', 'To Start a Fundraiser, follow the three steps:\r\n1. Sign up on crowd works India foundation’s platform\r\n2. Fill up the form\r\n3. Hit Submit\r\n', 1, 1, '2021-09-08 09:54:56', '2021-09-08 09:54:56'),
(5, 'What we are providing?', 'Payout: This is your money; you can withdraw it at any point during the course of your fundraiser.\r\nPersonalized Web & App: Get instant updates on your fundraiser\'s progress via instant alerts, email and track everything real-time on our web & app.\r\n\r\nDedicated Fundraiser expert: A dedicated fundraiser expert guides you through your fundraising\r\nKeep the raised amount: You will receive all the raised amount after the transactional fee and the prescribed donation to our corpus fund.\r\n\r\n24/7 support: We offer you 24*7 assistance via call, WhatsApp, Email, SMS and our Instant Chatting Interface.\r\n\r\nAdvertising support: We provide marketing and promotional support for your fundraiser\r\nFundraising Marketing tool: A highly intelligent marketing tool, which provides all insights on your fundraiser.\r\n', 1, 1, '2021-09-08 09:56:21', '2021-09-08 09:56:21'),
(6, 'Can I raise funds for a friend as well?', 'Yes, you can also raise funds for a friend, a loved one or anyone in need during life\'s crucial moments.', 1, 1, '2021-09-08 09:56:42', '2021-09-08 09:56:42'),
(7, 'Does the raised amount reach the individual directly?', 'With Crowd Works India Foundation, the money you collect goes directly to the bank account associated with your fundraising page. Raising money for yourself or anyone has never been easier.', 1, 1, '2021-09-08 09:57:05', '2021-09-08 09:57:05'),
(8, 'What if I don\'t reach my goal?', 'No problem. You will still receive the raised amount after the transactional processing fee.\r\nTo know more about transactional processing fee, visit:www.crowdworksindia.org/', 1, 1, '2021-09-08 09:57:45', '2021-09-08 09:57:45'),
(9, 'Is it safe?', 'Your CrowdworksIndia fundraiser features the very best in secure payment encryption technology. Not only are your donor’s online payments safe, your money is stored securely until you\'re ready to request a withdrawal via electronic bank transfer.', 1, 1, '2021-09-08 09:58:18', '2021-09-08 09:58:18'),
(10, 'I have more questions, who do I write to?', 'You can write to info@crowdworksindia.org Know someone who needs funds for medical treatment urgently? Help them out by sharing this information with them.\r\n\r\nSupport.crowdworksindia.org\r\n', 1, 1, '2021-09-08 09:58:44', '2021-09-08 09:58:44'),
(11, 'Where will the payment go ?', 'It will be going to crowd fund account through which it will be shared to donor', 0, 0, '2023-06-26 10:23:41', '2023-06-26 10:24:27'),
(12, 'where will the paymnet go', 'donor', 1, 0, '2023-06-26 10:24:51', '2023-06-26 10:25:02');
