(1, 4, 'WhatsApp Image 2023-10-18 at 12-25-35 PM-30a8d9821c5d91bbf33e98c8b73f40342d53d536.jpeg', 'Empowering Dreams: Providing Scholarships for Quality Education to Underprivileged Children in India', 400000, '2023-10-30', 'The right to education is considered one of the most important fundamental rights. Today, almost 35 million children in India are denied going to school each day. For financially weak families, the increasing expense of higher education is a major challenge. Despite the fees, other expenses lead to costly education. So there is a rising need for scholarships that helps students from financially struggling families attain quality education.\r\n\r\nOUR AIM AND APPROACH\r\nWe sponsor the education of children who cannot afford the expense of going to school. Some important concerns are providing necessities like food, tuition fees, transportation expenses, books, footwear, etc. Sponsoring the mid-day meals of poor tribal children is yet another aim. We find out the neediest among those struggling to pursue higher education and provide scholarships.\r\n', 'Empowering Dreams', 1, '2023-10-18 17:09:09', '2023-10-31 04:00:02', 'Allen ', 'noreply@crowdworksindia.org', '9946031111', 91, 18, 'Thomas', '', '', '', 'CROWD WORK INDIA FOUNDATION', '404005261724', 'Ratnakar Bank Ltd', 'RATN0000478', 'profile1-30a8d9821c5d91bbf33e98c8b73f40342d53d536.png', 1, 0, 0, 'va_MpkMzcU7xNWpFm', '1112220083022904', 'RAZR0000001', 'Crowd Works India Foundation', 'Current', 4, NULL, 1, NULL, 0, NULL, NULL),
(2, 5, 'WhatsApp Image 2023-10-18 at 12-10-00 PM-649efac159e1a94dfcd04fe7feb4e50f141e288e.jpeg', 'Ensuring Equal Health Care Access: Bridging the Gap for Underprivileged Communities in India', 400000, '2023-10-30', 'Health care is not a privilege. Every Indian citizen has access to public health care services. But still, many people die due to treatable diseases that cannot access the proper health services. People can also not bear medical expenses regarding serious health issues and treatments.\r\n\r\nOUR AIM AND APPROACH\r\nWe intend to provide medical facilities for people suffering from serious diseases. Conducting medical camps in rural and tribal areas and sponsoring the medical aid of underprivileged people. We sincerely try to avoid deaths from treatable diseases. We will ensure that the needy are not deprived of the country\'s healthcare services.\r\n', 'Ensuring Equal Health Care Access', 1, '2023-10-18 17:43:20', '2023-10-31 04:00:02', 'Allen ', 'noreply@crowdworksindia.org', '9946031111', 91, 18, 'Thomas', 'Injury ', 'Rajagiri Hospital', 'Aluva', 'CROWD WORK INDIA FOUNDATION', '404005261724', 'Ratnakar Bank Limited', 'RATN0000478', 'profile-649efac159e1a94dfcd04fe7feb4e50f141e288e.png', 1, 0, 0, 'va_Mpkx7HIrFjnPMK', '1112220057695902', 'RAZR0000001', 'Crowd Works India Foundation', 'Current', 4, NULL, 1, NULL, 0, NULL, NULL),
(3, 6, 'women-empowerment-5f9f90287c7c87da71769da6306802c1ca15768f-633ea7c2f47e6a4456f18d1f945ddc0e301b53ab.jpg', ' Empowering Women: Breaking Chains, Building Futures in India\r\n', 300000, '2023-10-31', 'Women in India face many social, physical, and economic challenges. Domestic violence, rape, and dowry killing are still prevalent in India. Around 60% of women in India are victims of domestic violence. This violence is always considered a private or family matter rather than considering it as a crime. This happens because of the depending nature of these women. Rural women lack job opportunities that prevent them from attaining a self-reliant state of life.\r\n\r\nOUR AIM AND APPROACH\r\nWorking for the socio-economic development of women, we aim to provide them with job-oriented training that can make them self-sufficient, especially for those women in rural areas. We stand for women workers\' rights. We help women to create an identity of their own, even as informal workers. We provide awareness camps that enable women to challenge oppressive norms and improve their self-confidence and leadership quality.\r\n', 'Empowering Women', 1, '2023-10-18 17:54:57', '2023-11-01 04:00:02', 'Allen ', 'noreply@crowdworksindia.org', '9946031111', 91, 18, 'Sindhu', '', '', '', 'CROWD WORK INDIA FOUNDATION', '404005261724', 'Ratnakar Bank Limited', 'RATN0000478', 'profile1-633ea7c2f47e6a4456f18d1f945ddc0e301b53ab.png', 1, 0, 0, 'va_Mpl9NZUzpYv11R', '1112220061791441', 'RAZR0000001', 'Crowd Works India Foundation', 'Current', 4, NULL, 1, NULL, 0, NULL, NULL),
(4, 7, 'child-care-71675ec0c09638c7dd2ade2d046b11656e52af64-0b355f3e255dcf55a75827dee4a9d3e30a95a8e0.jpg', 'Building Healthy Foundations: Empowering Children Through Comprehensive Childcare in India\r\n', 500000, '2023-10-25', 'Despite the fast-growing economy in India, malnutrition, poverty, and high child mortality rate are some of the major problems which are still prevalent. Environmental problems like pollution and excessive use of pesticides also affect child health adversely. More than 40% of children experience malnourishment and stunted growth due to a lack of a sufficient healthy diet. Providing proper childcare can be a stepping stone to disrupting the poverty cycle.\r\n\r\nOUR AIM AND APPROACH\r\nWe work to prevent the factors that inhibit a child from having a healthy childhood. One of our most important aims is to provide good healthcare services to children that keep them immune to various diseases. By providing healthcare facilities to mothers, newborns, and pregnant women, we work to avoid malnutrition. Nutritional food availability for children in rural and tribal areas will be ensured. \"Every child deserves a bright future\" is the philosophy that fuels our activities.\r\n', 'Building Healthy Foundations', 1, '2023-10-18 18:01:37', '2023-10-26 04:00:02', 'Allen ', 'noreply@crowdworksindia.org', '9946031111', 91, 22, 'John Mathew', '', '', '', 'CROWD WORK INDIA FOUNDATION', '404005261724', 'Ratnakar Bank Limited', 'RATN0000478', 'profile-0b355f3e255dcf55a75827dee4a9d3e30a95a8e0.png', 1, 0, 0, 'va_MplGQZKtkNewUw', '1112220037996157', 'RAZR0000001', 'Crowd Works India Foundation', 'Current', 4, NULL, 1, NULL, 0, NULL, NULL),
(5, 8, 'poverty-and-humanitarian-1ee503e2ff951c99cee33e8a44632abbba468aa5-53ea2a045a8e06ec3b07dd302e35c90ed0561600.jpg', 'Breaking the Chains of Poverty: Empowering Communities for a Brighter Tomorrow in India', 400000, '2023-11-04', 'Despite the developing nature of the country, poverty and inequality remain core challenges in India. Homeless people, child labor, hunger, injustice done to the poor, hardships of the migrant workers, etc., are some of the common humanitarian crises that India is facing. Recession in growth and high unemployment are causing existential hardship to the country\'s people.\r\n\r\nOUR AIM AND APPROACH\r\nWe aim to end poverty by contacting the needy to improve their living conditions. Our prime focus is on issues faced by rural or poor communities. Our plans to eliminate poverty are to increase opportunities that improve financial stability, improve skills that facilitate employment, and support communities in need by providing innovative and self-sustaining development programs. A great emphasis will be given to poor and landless farmers, needy women, uneducated children, and unemployed youth. We work hand in hand and focus on improving the living conditions in poor communities.\r\n', ' Breaking the Chains of Poverty', 1, '2023-10-18 18:10:07', '2023-11-05 04:00:02', 'Allen ', 'noreply@crowdworksindia.org', '9946031111', 91, 22, 'Christy James', '', '', '', 'CROWD WORK INDIA FOUNDATION', '404005261724', 'Ratnakar Bank Limited', 'RATN0000478', 'profile1-53ea2a045a8e06ec3b07dd302e35c90ed0561600.png', 1, 0, 0, 'va_MplPPGKbILMTQ9', '1112220005002508', 'RAZR0000001', 'Crowd Works India Foundation', 'Current', 4, NULL, 1, NULL, 0, NULL, NULL),
(6, 27, 'cancer-care-e4d5eed53c153453d378f97e4da0cdddbfe3cdaf-5a11b3cc55b42baedb50412d4a0010070483529d.jpg', 'Empowering Lives: Holistic Cancer Care for the Underprivileged in India\r\n', 500000, '2023-11-14', 'Every year 9.6 million people die due to cancer. Unfortunately, half the deaths occur due to ignorance and lack of care towards the disease. The Indian Council of Medical Research (ICMR) estimates that India will likely register over 17 lakh new cases and report over 8 lakh deaths by 2020. 70% of India\'s poor cancer patients lose their lives due to late detection of the disease, of which 15% are children. The majority of the people who belong to the low economic class cannot afford the treatment. Cancer survival depends upon early diagnosis. With the increase in cancer cases, the number of cancer centers with excellent infrastructure, trained oncologists, and good medical facilities is also increasing in urban India. But the truth is not the same in rural India.\r\n\r\nOUR AIM AND APPROACH\r\nOur aim is \"none cancer patients should suffer without timely treatment\". We reach out to the people who can\'t afford the treatment. The treatment also includes psychological and social support, rehabilitation therapies, etc. We provide holistic care for the needy, homeless, and afflicted women and children below the poverty line suffering from cancer. We raise funds to provide mobile palliative home care services for ill patients. The number of breast, cervical, and oral cancer cases is increasing considerably. So we provide cancer awareness programs to help the rural people with less knowledge about cancer.\r\n', 'Empowering Lives', 1, '2023-10-18 18:17:27', '2023-11-15 05:00:03', 'Allen ', 'noreply@crowdworksindia.org', '9946031111', 91, 18, 'Aravind', 'Cancer', 'Rajagiri Hospital', 'Eranakulam', 'CROWD WORK INDIA FOUNDATION', '404005261724', 'Ratnakar Bank Limited', 'RATN0000478', 'profile-5a11b3cc55b42baedb50412d4a0010070483529d.png', 1, 0, 0, 'va_MplX9khNhvTtMc', '1112220040102259', 'RAZR0000001', 'Crowd Works India Foundation', 'Current', 4, NULL, 1, NULL, 0, NULL, NULL),
(7, 10, 'disaster-managment-36bd6e52663d78cee244ace4077375877b769520-bd0d8923facb82eaf6c655a496066d1ad754b983.jpg', 'Protecting India\'s Vulnerable: Disaster Relief and Preparedness for a Safer Tomorrow\r\n', 300000, '2023-10-27', 'Natural disasters cause great damage across India because of its unique geo-climatic conditions and high socio-economic vulnerability to calamities. The Global Climate Risk Index report of 2019 listed India as the 14th most vulnerable country in the world due to extreme weather conditions. It also results in the subsequent loss in agriculture, which distress the farmers. The impact of natural disasters increases due to the lack of preparedness. Poor and weaker members of society have always been more vulnerable to various disasters. This results in unacceptably high morbidity and mortality amongst the affected population.\r\n\r\nOUR AIM AND APPROACH\r\nWhen nature shows its wrath, people must be protected. We aim to provide immediate support to manage relief services by making resources available. The survivors will be provided food packets, temporary shelters, clothes, and basic amenities like ration kits, medical kits, etc. We reach out to the victims with appropriate medical services. We are putting a great emphasis on delivering the resources to the right people at the right time.\r\n', 'Strengthening Resilience', 1, '2023-10-18 18:22:02', '2023-10-28 04:00:02', 'Allen ', 'noreply@crowdworksindia.org', '9946031111', 91, 17, 'Danish', '', '', 'Koratty', 'CROWD WORK INDIA FOUNDATION', '404005261724', 'Ratnakar Bank Limited', 'RATN0000478', 'profile1-bd0d8923facb82eaf6c655a496066d1ad754b983.png', 1, 0, 21, 'va_Mplbza7XxSiYgj', '1112220096778298', 'RAZR0000001', 'Crowd Works India Foundation', 'Current', 4, NULL, 1, NULL, 0, NULL, NULL),
(18, 7, 'image_cropper_1697794869824-430d09db74c7cf09a355256a53c91cf13e9885c9.jpg', 'Child care', 200, '2023-10-22', 'Child care', NULL, 1, '2023-10-20 09:42:28', '2023-10-20 09:55:17', 'Nima k', 'nimakcpy98@gmail.com', '8078126095', 91, 6, 'Nima K', '', '', '', 'Nima K', '921010030107815', 'Axis Bank', 'UTIB0002174', 'image_cropper_1697794850916-430d09db74c7cf09a355256a53c91cf13e9885c9.jpg', 113, 1, 200, 'va_MqPtdYa9Hyta24', '1112220025135843', 'RAZR0000001', 'Crowd Works India Foundation', 'Current', 4, 3, 0, 'rzr.payto000001201007065@icic', 0, NULL, NULL),
(19, 7, 'image_cropper_1697796677141-604e7b5e800db478eb1d364bc987c876296c7d18.jpg', 'Child care', 200, '2023-10-22', 'Child care', NULL, 1, '2023-10-20 10:11:51', '2023-10-20 10:27:02', 'Chn', 'bufh@gmail.com', '8078126092', 91, 11, 'Nima', '', '', '', 'Nima k', '58296314785', 'Axis Bank', 'UTIB0002174', 'image_cropper_1697796661210-604e7b5e800db478eb1d364bc987c876296c7d18.jpg', 113, 1, 200, 'va_MqQOwz3D8YzD81', '1112220065476334', 'RAZR0000001', 'Crowd Works India Foundation', 'Current', 4, 2, 0, 'rzr.payto000003012944836@icic', 0, NULL, NULL),
