(15, 'Covid Relief Fund - Oxygen Is Life', 'We are in the middle of a pandemic that has affected each and everyone in some way or another and the second wave is even worse. All the medical institutions are full and in need of oxygen supply. Looking at this situation we want to help those who are in-home care and struggling for Oxygen by providing Oxygen concentrators to patients at their home so that the patients who need basic oxygen support doesn\'t have to stay in hospital and can get treated at home.\r\n\r\nThis will reduce the pressure on the Hospital and currently when the patient is not getting a bed and also are fighting for life due to Oxygen will get saved and can still get oxygen.', 300000, 'Kerala', 'This is a 100% non-for-profit and charitable initiative. For oxygen concentrators we need 5x times the funds so we are requesting help from society to join hands in this noble cause and help the needy.', '2021-08-01', 19, '608956d568e62-892368d34c5125d96a5278e1e0bd3346526aa5cc.jpeg', 0, '2021-06-05 10:56:24', '2021-07-07 08:41:23', NULL, NULL, NULL, NULL, NULL, 1),
